import React, { Component, Fragment } from "react";
import Contact from "./Contact";

class Contacts extends Component {
  constructor() {
    super();
    this.state = {
      contacts: [
        {
          id: 1,
          name: "Justin Haney",
          email: "jahaney@west.com",
          phone: "251-447-9323"
        },
        {
          id: 2,
          name: "Brad Hughes",
          email: "brad@west.com",
          phone: "251-123-6549"
        },
        {
          id: 3,
          name: "Chase Harrison",
          email: "chase@west.com",
          phone: "251-555-6881"
        }
      ]
    };
  }
  render() {
    const { contacts } = this.state;
    return (
      <Fragment>
        {contacts.map(contact => (
          <Contact
            name={contact.name}
            email={contact.email}
            phone={contact.phone}
          />
        ))}
      </Fragment>
    );
  }
}

export default Contacts;
